                &copy; {new Date().getFullYear()} Copyright: <span bg-indigo-800> Hiba TOUDERTI. </span>
                
                <br className="hidden lg:inline-block" />
                <text>All Rights Reserved.</text>
            </div>

        </footer>
    );
}
